function SideNav({catalog}) {
    return (
        <nav className="sidenav mt-3" style={{width: '250px'}}>
            <h5 className="text-center">Filter</h5>

            <div className="col-md-12 col-sm-8 mb-2">
                <select className="custom-dropdown w-full" placeholder="Select an option">
                    <option value="" default>Make</option>
                    {new Set(catalog.map(item => item.make)).map((item, index) => (
                        <option key={index} value={item.make}>{item.make}</option>
                    ))}
                </select>
            </div>

            <div className="col-md-12 col-sm-8 mb-2">
                <select className="custom-dropdown w-full" placeholder="Select an option">
                    <option value="" default>Model</option>
                    {catalog.map((item, index) => (
                        <option key={index} value={item.model}>{item.model}</option>
                    ))}
                </select>
            </div>
        </nav>
    );
}

export default SideNav;
